AÇÃO  CONJUNTA  DAS  PARTES  NA  REALIZAÇÃO  DE APOIO ÀS ELEIÇÕES GERAIS 2022,  NO ESTADO DO AMAZONAS, VISANDO BENEFICIAR OS CIDADÃOS ENVOLVIDOS. A IMPLEMENTAÇÃO DO OBJETO CONSISTE EM: 
-  RECRUTAMENTO  E  SELEÇÃO  DE  CANDIDATOS  PARA  POSTOS  DE  TRABALHO,  NOS  CARTÓRIOS  ELEITORAIS,  LOCAIS  DE ARMAZENAMENTO DE URNAS ELETRÔNICAS, PONTOS DE TRANSMISSÃO E LOCAIS DE VOTAÇÃO; 
- CAPACITAÇÃO PARA ATUAÇÃO JUNTO AOS CIDADÃOS ENVOLVIDOS; 
- ACOMPANHAMENTO E SUPERVISÃO DAS ATIVIDADES.
